{
  "attribute_id": "el:AcquisitionBatchSize",
  "project": "EL",
  "risk": "Low",
  "rationale": "A simple numeric count of samples in an acquisition batch; non-personal technical/study logistics metadata with no direct identifiers or quasi-identifiers and minimal re-identification risk."
}

{
  "attribute_id": "htan:AdapterContent",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "FASTQC 'AdapterContent' is a technical QC metric describing adapter sequence content in sequencing reads. It conveys no personal identifiers or quasi-identifying information and pertains to technical file-level quality, so it is non-personal technical metadata."
}

{
  "attribute_id": "htan2:AdapterName",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "Name of the sequencing adapter is technical laboratory metadata (library/prep detail) and does not reveal personal identity, location, contact, or sensitive clinical information."
}

{
  "attribute_id": "htan:AlignmentWorkflowType",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "Describes the technical analysis workflow applied to a dataset (pipeline name/type). This is non-personal technical metadata about processing and does not identify individuals or provide quasi-identifiers."
}

{
  "attribute_id": "htan2:AverageInsertSize",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "AverageInsertSize is a technical sequencing metric (fragment/insert length from samtools). It is non-personal technical metadata that does not directly identify individuals or serve as a quasi-identifier, so it poses low re-identification risk."
}

{
  "attribute_id": "nf-osi:AverageReadLength",
  "project": "NF-OSI",
  "risk": "Low",
  "rationale": "Average read length is technical sequencing metadata (samtools output) that does not identify individuals or reveal sensitive clinical/behavioral information; it is non-personal instrument/sample metric."
}

{
  "attribute_id": "htan:BisulfiteConversion",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is technical laboratory metadata (name of bisulfite conversion kit) describing reagents/protocol components, not personal, demographic, or specimen-identifying information, and therefore poses low re-identification or sensitivity risk."
}

{
  "attribute_id": "htan:CDSbases",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is a non-personal technical sequencing metric (count of unique basecalls) describing data content/quality. It does not directly identify individuals or provide quasi-identifying demographic, location, or clinical information."
}

{
  "attribute_id": "htan:CDScustomAssemblyFastaFileForAlignment",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is a technical metadata field (name of the custom assembly FASTA file used for alignment). It does not contain personal identifiers, demographics, or sensitive clinical data and thus poses low re-identification risk."
}

{
  "attribute_id": "htan:CDSdesignDescription",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is a free-form technical description of sequencing library preparation methods (materials and methods). It contains non-personal laboratory and protocol details rather than identifiers, quasi-identifiers, or sensitive clinical/behavioral data, so it is categorized as low risk."
}

{
  "attribute_id": "htan2:CDSnumberOfReads",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is a technical metric (total number of sequencing reads) describing file content. It does not directly identify individuals, reveal contact/clinical/precise location data, or serve as a quasi-identifier—therefore classified as non-personal technical metadata (Low)."
}

{
  "attribute_id": "htan2:CDSreferenceGenomeAssembly",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is technical metadata indicating which NCBI reference genome assembly was used for aligning a BAM file. It does not contain personal identifiers or quasi-identifiers and is non-sensitive instrument/processing information."
}

{
  "attribute_id": "htan:CDSreferenceGenomeAssembly",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This attribute records the reference genome assembly used for BAM alignment (a technical detail about file processing). It does not contain personal identifiers or quasi-identifiers; it is non-personal technical metadata relevant to data processing and interpretation."
}

{
  "attribute_id": "gf:CellBarcodeTag",
  "project": "GF",
  "risk": "NeedsReview",
  "rationale": "Attribute description is 'TBD' with no validation rules or valid values. Name suggests a cell barcode which could be a persistent identifier or linkable quasi-identifier, but scope and formatting are unclear—insufficient information to classify."
}

{
  "attribute_id": "htan:CosMxAssayType",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "Describes technical assay type (RNA probe vs protein antibody) and barcode specification for images; this is non-personal technical metadata about the experimental assay rather than an identifier or sensitive individual-level attribute."
}

{
  "attribute_id": "htan:DataCollectionMode",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is technical instrument metadata describing mass spectrometry acquisition mode (DDA vs DIA). It does not contain identifying, demographic, or sensitive personal information and is non-personal study metadata."
}

{
  "attribute_id": "el:DatabaseVersion",
  "project": "EL",
  "risk": "Low",
  "rationale": "This describes a technical metadata field (database version) with no personal or identifying information. It does not reveal identities or sensitive clinical/financial data and therefore is low risk."
}

{
  "attribute_id": "htan:DuplicateRead-Pairs",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is a technical sequencing QC metric (count of duplicate read-pairs). It does not directly or indirectly identify individuals or reveal sensitive clinical, demographic, or location information, so it is non-personal technical metadata."
}

{
  "attribute_id": "htan:EMstagetilt",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "Stage tilt in degrees is an instrument technical parameter (microscope setting). It is non-personal technical metadata and does not reveal identity, sensitive clinical, or cohort information."
}

{
  "attribute_id": "btc:Encoding",
  "project": "BTC",
  "risk": "Low",
  "rationale": "Technical file-format metadata describing ASCII encoding of quality scores (e.g., Phred+33/+64). Non-personal instrument/file property with negligible re-identification or sensitive information risk."
}

{
  "attribute_id": "htan2:EndBias",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "Describes technical sequencing/library property (3'/5' tag or full-length transcript) rather than any personal, demographic, or cohort information; non-identifying experimental metadata."
}

{
  "attribute_id": "el:ExtractionMethod",
  "project": "EL",
  "risk": "Low",
  "rationale": "This is technical protocol metadata describing the laboratory process used to separate components (extraction method). It contains no personal identifiers, quasi-identifiers, or sensitive content and thus is non-personal technical metadata."
}

{
  "attribute_id": "htan2:FOVXUnit",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "Specifies the units for the field-of-view X dimension (e.g., microns) — technical imaging metadata about measurement units. Non-personal and does not reveal identity or sensitive information."
}

{
  "attribute_id": "htan:FOVnumber",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "An integer sequence index for field-of-view (FOV) order; this is non-personal technical metadata (file/measurement ordering) and does not directly identify individuals or sensitive attributes."
}

{
  "attribute_id": "adkp:FileFormat",
  "project": "ADKP",
  "risk": "Low",
  "rationale": "FileFormat describes the technical format/extension or software group of the data file — non-personal technical metadata about files, not identifying or sensitive."
}

{
  "attribute_id": "htan2:FileFormat",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "File format is non-personal technical metadata (e.g., txt, csv, fastq, bam). It does not contain identifiers or quasi-identifiers and poses minimal re-identification or sensitivity risk."
}

{
  "attribute_id": "el:Filename",
  "project": "EL",
  "risk": "NeedsReview",
  "rationale": "Description is listed as TBD and there are no validation rules or valid values. It is unclear whether filenames may contain direct identifiers, dates, or other sensitive data, so insufficient information is available to classify risk."
}

{
  "attribute_id": "htan2:FragmentStandardDeviationLength",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is a technical measurement describing the variability of sequenced fragment lengths (e.g., Bioanalyzer output). It is non-personal instrument/library QC metadata and does not directly identify individuals or serve as a quasi-identifier."
}

{
  "attribute_id": "htan:FrameAveraging",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is a technical imaging acquisition parameter (number of frames averaged, integer >=1). It is non-personal technical metadata and does not reveal identity, contact, location, or sensitive clinical information, so privacy risk is low."
}

{
  "attribute_id": "nf-osi:GenePerturbed",
  "project": "NF-OSI",
  "risk": "Low",
  "rationale": "The attribute is a HUGO gene symbol specifying which gene was perturbed in an experiment; it is technical experimental metadata and does not contain personal identifiers, contact, location, or cohort/participant information."
}

{
  "attribute_id": "htan2:GenomeAnnotationURL",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is a link to a public genome annotation (GTF) file (reference resource URL). It contains no personal or cohort-identifying information and is technical/reference metadata, so it poses low privacy risk."
}

{
  "attribute_id": "htan2:GeoMxDSPGenomicReference",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is technical metadata specifying the exact human genome reference version used for alignment (tool/reference version). It does not contain personal identifiers or quasi-identifiers and poses minimal re-identification risk."
}

{
  "attribute_id": "htan:GeoMxDSPUniqueTargetCount",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This attribute is an aggregate technical/biological metric (total number of unique genes reported). It does not contain direct identifiers, quasi-identifiers, or individual-level genomic sequences and therefore poses low re-identification risk."
}

{
  "attribute_id": "htan:HTANParentBiospecimenID",
  "project": "HTAN",
  "risk": "Moderate",
  "rationale": "This is a biospecimen identifier linking files to specific specimen(s) (e.g., HTANx_yyy_zzz). While not a direct personal identifier, specimen IDs can be used to link records across datasets or back to donors and thus could aid re-identification."
}

{
  "attribute_id": "el:IsMultiSpecimen",
  "project": "EL",
  "risk": "Low",
  "rationale": "A simple boolean indicating whether a file contains multiple specimens; this is non-personal technical metadata about file contents and does not directly identify individuals or provide quasi-identifiers."
}

{
  "attribute_id": "el:LabelFreeQuantitation",
  "project": "EL",
  "risk": "Low",
  "rationale": "This describes a technical metadata field about the type of label-free data analysis strategy (methodological/study-level information) with no personal identifiers or quasi-identifiers, so it is non-personal technical metadata."
}

{
  "attribute_id": "gf:LaneNumber",
  "project": "GF",
  "risk": "Low",
  "rationale": "Represents a technical sequencing instrument property (physical lane number on Illumina machines). It is non-personal technical metadata used for analysis logistics and does not directly identify individuals or materially aid re-identification."
}

{
  "attribute_id": "htan2:LibrarySelectionMethod",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "Describes a technical laboratory method (how RNA molecules are isolated) used in library preparation. This is non-personal experimental metadata and does not directly identify individuals or provide quasi-identifiers."
}

{
  "attribute_id": "nf-osi:LibraryStrand",
  "project": "NF-OSI",
  "risk": "Low",
  "rationale": "Library strandedness is a technical sequencing/library preparation parameter used for RNA-seq analysis. It is non-personal technical metadata and does not reveal identity, contact, location, or sensitive clinical information."
}

{
  "attribute_id": "htan2:MACS2NegLog10qvalueSummit",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is a technical peak-calling metric (negative log10 q-value for MACS2 peak summit) describing signal significance. It does not contain personal identifiers, demographic or clinical information and is non-personal technical metadata."
}

{
  "attribute_id": "htan2:MACS2Score",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "MACS2Score is a technical numeric output from peak-calling (peak score proportional to q-value). It does not contain direct identifiers, quasi-identifiers, or sensitive personal information and therefore is non-personal technical metadata."
}

{
  "attribute_id": "htan2:MapQ30",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is a sequencing quality metric (count of reads with quality >=30), a technical QC value unrelated to personal identity or demographics. It does not constitute an identifier or quasi-identifier and poses low re-identification risk."
}

{
  "attribute_id": "htan:MapQ30",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is a technical sequencing QC metric (count of reads with quality >=30). It conveys non-personal technical information about data quality/depth and does not directly identify individuals or reveal sensitive clinical/ demographic information."
}

{
  "attribute_id": "htan2:MedianNumberGenesperSpatialSpot",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "This is a technical QC metric summarizing the median number of genes detected per spatial spot (presence >=1 UMI). It is non-identifying technical metadata about sequencing/library performance and does not contain personal identifiers or sensitive clinical information."
}

{
  "attribute_id": "htan:MedianPercentageofMitochondrialReadsperNucleus",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "This is a technical QC metric (median percent mitochondrial reads per nucleus) indicating sequencing contamination; it is non-identifying technical metadata and does not reveal personal identity, contact, precise location, financial, or sensitive clinical information."
}

{
  "attribute_id": "htan:MicroarrayLabel",
  "project": "HTAN",
  "risk": "Low",
  "rationale": "Describes a technical assay property (type of label used on a microarray). This is instrument/experimental metadata and does not reveal personal identity, demographics, or sensitive clinical information."
}

{
  "attribute_id": "htan2:MicroarrayMolecule",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "Describes the type of molecule measured by a microarray (e.g., RNA, DNA, protein). This is technical assay metadata and does not reveal personal identity, contact, location, or sensitive clinical information."
}

{
  "attribute_id": "nf-osi:Nf2Genotype",
  "project": "NF-OSI",
  "risk": "High",
  "rationale": "This is individual-level genetic information (NF2 gene genotype) derived from a biospecimen. Genomic data can reveal disease risk and is potentially identifiable and highly sensitive, so it meets the High sensitivity category."
}

{
  "attribute_id": "htan2:NormalizationMethod",
  "project": "HTAN2",
  "risk": "Low",
  "rationale": "Describes a data processing/normalization method (technical metadata). It does not contain personal identifiers, quasi-identifiers, or sensitive clinical/financial information; therefore it is non-personal technical metadata."
}

{
  "attribute_id": "htan:PUC19methylationratio",
