  "risk": "Low",
  "rationale": "This is a technical QC metric describing the methylation ratio (percentage) of a pUC19 control plasmid. It is non-personal assay control metadata and does not reveal individual identity or sensitive personal information."
}

{
  "attribute_id": "htan:PctReadsinPeaks",
