  "risk": "Low",
  "rationale": "This is a technical sequencing quality metric (percentage of reads in peaks), which does not contain personal identifiers or quasi-identifiers and relates to assay performance rather than individual-specific information."
}

{
  "attribute_id": "nf-osi:ProportionCoverage10x",
