  "risk": "Low",
  "rationale": "This is a technical sequencing quality metric (proportion of bases with ≥10X coverage from Picard Tools). It contains no direct identifiers or sensitive clinical/demographic information and is non-personal technical metadata."
}

{
  "attribute_id": "htan:RPPADilution",
